import React from 'react';
import './Post.scss';
import { Link } from "react-router-dom";

export const Post = props => {

  return (
      <div className="posts">
        <Link to={"/" + props.id}>{props.Name}</Link>
        <p>{props.Ticket}</p>
      </div>
  );
}

export default Post;
